import './App.css';
import Nav from './components/Nav';
import Footer from './components/Footer';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return (
  <header>
  <Router>
    <Nav/>
    <Routes>
      <Route path='/' element={<Home/>}/>
    </Routes>
  </Router>
    <Footer />
  </header>
  );
}

export default App;
